    public function setUp()
    {
        parent::setUp();

        foreach (self::$data as $table => $rows) {
            self::insertRowData($table, $rows['before']);
        }
    }

    private static function insertRowData($unprefixedTable, $rows)
    {
        $table = Common::prefixTable($unprefixedTable);
        foreach ($rows as $row) {
            $placeholders = array_map(function () { return "?"; }, $row);
            $columns = array_keys($row);
            foreach ($columns as &$column){
                $column = '`' . $column . '`';
            }

            $sql = "INSERT INTO $table (" . implode(',', $columns) . ") VALUES (" . implode(',', $placeholders) . ")";
            Db::query($sql, array_values($row));
        }
    }
}

foreach (array('before', 'after') as $status) {
    //Add crc32
    foreach(TrackedData::$data['log_action'][$status] as &$row) {
        $row['hash'] = crc32($row['name']);
    }

    //Encode config id in log_visit
    foreach (TrackedData::$data['log_visit'][$status] as &$row) {
        $row['config_id'] = pack("H*", $row['config_id']);
    }

    //Encode idvisitor
    foreach (array('log_visit', 'log_link_visit_action', 'log_conversion') as $tableName) {
        foreach (TrackedData::$data[$tableName][$status] as &$row) {
            $row['idvisitor'] = pack("H*", $row['idvisitor']);
        }
    }

    //TODO ip and so...
